window.bookSummaryJSON = "<p>The crew of the USCG Buoy Tender Sassafras, out of Honolulu, has embodied the Coast Guard’s motto: Always ready, in every mission, every circumstance, every crazy thing mother nature and the US government has seen fit to dump in their laps. They’ve been doing so much, with so little, for so long, they feel ready to face anything. But then, they’ve never had to face a zombie apocalypse.</p>"; 
